import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Experience extends Component {
  render() {
    return(
      <Grid>
        <Cell col={12}>
          <p>I am a fresher but have done few projects which helped me learn new things. Also I have made commercial wordpress websites which helped me gain experience on how to manage things.I have developed a wordpress site for the startup Homy Market https://homimarket.com . Worked as the Chief Technical officer at Homy Market.</p>
        </Cell>
      </Grid>
    )
  }
}

export default Experience;
